window.bookSummaryJSON = "<p>Forget the lottery. Teenager Charlie Newell has just discovered something that will make him and his friends billionaires. What if a world existed in which no humans ever evolved? No cities. No pollution. No laws. A fantastic world filled with unimaginable riches in which everything - everything - was yours just for the taking? </p> <p>Charlie has found that world. And he plans to use it to make him and his friends rich.There is a problem: How do you keep something this big a secret?</p>"; 
